import styles from './Modal.module.css';
import Input from "./Input";


const Modal=()=>{
    return(
        <div className={styles.backdrop}>
            <div className={styles.modal}>
                <p>test</p>
                <Input id='test'/>
            </div>
        </div>
    );
}

export default Modal;
